settings.cardCss:
body {
    background-color: #333;
    /*background: url('https://energy-app.utech-iiot.lk/api/images/public/t9i6PVDRoaxUf0HheoJrwkgg84ImheqB') no-repeat center center;*/
    color: #fff;
    font-family: Arial, sans-serif;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    margin: 0;
}

footer {
    text-align: center;
    padding: 1rem;
    background: linear-gradient(90deg, #3a3a5f, #242435);
    color: white;
    border-top: 2px solid #444;
    margin-top: 4px;
    text-shadow: 1px 1px 3px #000;
}

.background {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    object-fit: cover;
    z-index: -1;
}

.container {
    z-index: 1;
    text-align: center;
    height: 1160px;
}

h1 {
    font-size: 4em;
    margin-bottom: 10px;
    color: #f8fdf6;
}

.logo {
    width: 300px;
    margin-bottom: 20px;
}

.menu {
    display: flex;
    justify-content: center;
    gap: 120px;
}

.menu-item {
    text-align: center;
    margin: 0 40px;
}

.menu-item img {
    width: 200px;
    height: 200px;
    display: block;
    margin: 0 auto 10px;
}

.menu-item p {
    margin: 0;
    font-size: 3em;
    color: #f8fdf6;
}

.energy-widget {
    font-family: Arial, sans-serif;
    max-width: 100%;
    border-radius: 8px;
    box-shadow: 0 2px 8px rgba(255, 255, 255, 0.1);
    overflow: hidden;
    background: #121212;
    color: #e0e0e0;
    justify-content: center;
}

.widget-header {
    background: linear-gradient(135deg, #1a1a2e 0%, #16213e 100%);
    color: white;
    padding: 10px 15px;
    font-weight: bold;
    font-size: 16px;
}

.widget-content {
    padding: 15px;
    background: #0f0f0f;
}

.metrics-section {
    margin-bottom: 20px;
}

.metrics-section:last-child {
    margin-bottom: 0;
}

.section-title {
    font-weight: bold;
    margin-bottom: 8px;
    font-size: 14px;
    color: #e0e0e0;
    display: flex;
    justify-content: space-between;
    align-items: center;
}

.time-period-tabs {
    display: flex;
    background: #1e1e1e;
    border-radius: 4px;
    overflow: hidden;
    font-size: 12px;
    margin-bottom: 12px;
}

.time-tab {
    padding: 5px 10px;
    cursor: pointer;
    color: #a0a0a0;
}

.time-tab.active {
    background: #e94560;
    color: white;
}

.metrics-container .period-data {
    display: none;
}

.metrics-container .period-data.active {
    display: block;
}

.metrics-grid {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    gap: 10px;
}

.metric-box {
    background-color: #1e1e1e;
    border-radius: 6px;
    padding: 8px 6px;
    text-align: center;
    border: 1px solid #333;
}

.metric-value {
    font-size: 24px;
    font-weight: bold;
    color: #ffffff;
}

.metric-label {
    font-size: 20px;
    color: #888;
    margin-top: 4px;
}

.transformer1-metrics .metric-value {
    color: #ff6b6b;
}

.transformer2-metrics .metric-value {
    color: #ff9f1c;
}

.solar-metrics .metric-value {
    color: #4ecdc4;
}

.loader {
    border: 3px solid #f3f3f3;
    border-top: 3px solid #3498db;
    border-radius: 50%;
    width: 30px;
    height: 30px;
    animation: spin 1s linear infinite;
    margin: 10px auto;
}

@keyframes spin {
    0% {
        transform: rotate(0deg);
    }

    100% {
        transform: rotate(360deg);
    }
}

.loading .metric-value {
    visibility: hidden;
    position: relative;
}

.loading .loader {
    display: block;
}

.loader {
    display: none;
}
